import { TOP_CHART_MUSIC, NEW_RELEASES } from "../ActionTypes/ActionTypes";

export const topChartMusic = () => (dispatch, getState, Api) => {
  return Api.get("topcharts/getAllMusic").then((response) => {
    console.log("111111", response);
    if (response.response.status === 200) {
      dispatch({
        type: TOP_CHART_MUSIC,
        payload: response.responseData,
      });
    }
    return response;
  });
};

export const newReleaseMusic = () => (dispatch, getState, Api) => {
  return Api.get("/new-release").then((response) => {
    console.log("111111", response);
    if (response.response.status === 200) {
      dispatch({
        type: NEW_RELEASES,
        payload: response.responseData,
      });
    }
    return response;
  });
};
